import { Box, Flex } from "@chakra-ui/react";

function HomePage() {
    return(
        <Flex height="100%" bgGradient='linear(to-b,#FFFFFF, #2F6690)'>
            <Box margin="10px">
                <p>Home</p>
            </Box>
        </Flex>
    );
}

export default HomePage;
